nav{
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 30px 0 10px;
}

nav ul li{
    display: inline-block;
    list-style: none;
    margin: 10px 30px;
}

.logo{
    width: 160px;
    cursor: pointer;
}


.logo .line{
    width: 70px;
    height: 5px;
    background-color:white ;
}

nav ul li a{
    text-decoration: none;
    color: white;
    font-size: 17px;
    letter-spacing: 1px;
}
nav ul li a{
    text-decoration: none;
    color: #fff;
    font-size: 20px;
}
nav ul li a:hover{
    color: green;
}

.text-box{
    margin: 16px;
    font-size: 22px;
}

.text-box h1{
    padding-top: 15%;
    font-size: 85px;
    font-weight: 600;
    line-height: 100px;
    margin-bottom: 10px;
}

.text-box .btn{
    outline: none;
    border: none;
    font-size: 16px;
    margin-top: 30px;
    background: green;
    color: white;
    padding: 14px 40px;
    cursor: pointer;
}


.download{
   position: absolute;
   right: 7%;
   bottom: 60px;
   display: flex;
   align-items: center;
   text-decoration: none;
   color: green;
   padding: 20px 40px ;
   border-radius: 40px;
   transition: background 0.3s;
}

.download img{
    width: 25px;
    margin-left: 15px;
    animation: move 2s linear infinite;
}
